"use strict";window.addEventListener("DOMContentLoaded",()=>{const outputButton=document.querySelector("#output-button");outputButton.addEventListener("click",()=>{outputButton.classList.toggle("active");var panel=document.querySelector("#output-panel");"block"===panel.style.display?panel.style.display="none":panel.style.display="block"})}),window.addEventListener("load",()=>{document.querySelector("#code-editor").contentWindow.postMessage({language:"java",eventType:"populateCode",files:[{name:"main.java",content:document.querySelector("#initial-code").textContent}]},"*")});